import { createBrowserRouter, createRoutesFromElements, Route, RouterProvider, ScrollRestoration } from "react-router-dom";

import Header from './components/assets/header/header.jsx';
import Footer from './components/assets/footer/footer.jsx';
import Main from './pages/main/main.jsx';
import About from './pages/about/about.jsx';
import NewsList from './pages/news/newslist/newslist.jsx';
import News from "./pages/news/news.jsx";

import "./styles/reset.css";
import "./styles/main.css";


function App() {
  return (
    <div className="App">
      <createBrowserRouter> 
        <Header />
          <Route path="/" element={<Main />} />
          <Route path="about" element={<About />} />
          <Route path="newslist" element={<NewsList />} />
          <Route path="news" element={<News />} />
        <Footer />
      </createBrowserRouter>
    </div>
  );
}

export default App;
